   "\\(AH = \\frac{\\mathcal{M}_\\omega}{\\vee_{net}}\\),\nwhere \\(\\mathcal{M}_\\omega\\) is the mass of water vapor per unit volume of total air and \\(\\vee_{net}\\) is water vapor mixture.",
   :qudt/symbol "AH",
