                         :unit/MilliGAL
                         :unit/MicroG
                         :unit/KiloPA-M2-PER-GM
                         :unit/M-PER-SEC2
                         :unit/MilliG],
   :qudt/dbpediaMatch "http://dbpedia.org/resource/Acceleration",
