   :qudt/dbpediaMatch "http://dbpedia.org/resource/Curvature",
   :qudt/hasDimensionVector :qkdv/A0E0L-1I0M0H0T0D0,
   :qudt/informativeReference "http://en.wikipedia.org/wiki/Curvature",
   :qudt/plainTextDescription
   "The canonical example of extrinsic curvature is that of a circle, which has curvature equal to the inverse of its radius everywhere. Smaller circles bend more sharply, and hence have higher curvature. The curvature of a smooth curve is defined as the curvature of its osculating circle at each point. The osculating circle of a sufficiently smooth plane curve at a given point on the curve is the circle whose center lies on the inner normal line and whose curvature is the same as that of the given curve at that point. This circle is tangent to the curve at the given point.\nThat is, given a point P on a smooth curve C, the curvature of C at P is defined to be 1/R where R is the radius of the osculating circle of C at P. The magnitude of curvature at points on physical curves can be measured in diopters (also spelled dioptre)  this is the convention in optics. [Wikipedia],",
