   "https://www.gigahertz-optik.com/en-us/service-and-support/knowledge-base/measurement-of-par/",
   :qudt/plainTextDescription
   "Photosynthetically Active Radiation are the wavelengths of light within the visible range of 400 to 700 nanometers (nm) that are critical for photosynthesis. PPFD measures the amount of PAR light (photons) that arrive at the plants surface each second. The PPFD is measured at various distances with a Full-spectrum Quantum Sensor, also known as a PAR meter. Natural sunlight has a PAR value of 900-1500Mol/m2/s when the sun is directly overhead. For a grow light to be effective, it should have PAR values of 500-1500 Mol/m2/s.",
