   ["http://pds-atmospheres.nmsu.edu/education_and_outreach/encyclopedia/planck_function.htm"
    "http://ntrs.nasa.gov/archive/nasa/casi.ntrs.nasa.gov/19680008986_1968008986.pdf"
    "http://www.star.nesdis.noaa.gov/smcd/spb/calibration/planck.html"],
   :qudt/isoNormativeReference
   "http://www.iso.org/iso/catalogue_detail?csnumber=31890",
   :qudt/latexDefinition
   "The Planck function, \\(B_{\\tilde{\\nu}}(T)\\), is given by:\n\\(B_{\\nu}(T) = \\frac{2h c^2\\tilde{\\nu}^3}{e^{hc / k \\tilde{\\nu} T}-1}\\)\nwhere, \\(\\tilde{\\nu}\\) is wavelength, \\(h\\) is Planck's Constant, \\(k\\) is Boltzman's Constant, \\(c\\) is the speed of light in a vacuum, \\(T\\) is thermodynamic temperature.",
   :rdf/type :qudt/QuantityKind,
   :rdfs/isDefinedBy "http://qudt.org/2.1/vocab/quantitykind",
